console.log("Make Scheduler Based Again.");
window.addEventListener("load", () => {
    let qrEl = document.getElementsByClassName("menu_qrpay")[0];
    if (qrEl) {
        qrEl.children[0].innerText = "Vtip dne";
        qrEl.children[1].innerText = "zobrazit";
        qrEl.children[1].href = "";
        qrEl.children[1].addEventListener("click", () => {
            let image = new Image();
            image.src = "data:image/png;base64,";
            let w = window.open("");
            w.document.write(image.outerHTML);
        });
    }

    let logoEl = document.getElementsByClassName("header_logo")[0];

    if (logoEl){

        logoEl.style.backgroundImage = "url(data:image/png;base64,)";
        logoEl.style.width = "150px";
    }
    let linkEl = document.querySelector("link[rel~='icon']");
    if (!linkEl) {
        linkEl = document.createElement("link");
        linkEl.rel = "icon";
        document.head.appendChild(linkEl);
    }
    linkEl.href = "data:image/png;base64,";

    let credEl = document.evaluate("//div[contains(@class, 'secs_info')]//div[@class='info_full']//div[@class='foot_left'][last()]", document, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null).singleNodeValue;
    if (credEl) {
        credEl.innerText = "";
    }

});